BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS "perfumes" (
	"id"	INTEGER,
	"Nama Parfum"	TEXT,
	"Brand atau Produsen"	TEXT,
	"Jenis"	TEXT,
	"Kategori Aroma"	TEXT,
	"Top Notes"	TEXT,
	"Middle Notes"	TEXT,
	"Base Notes"	TEXT,
	"Kekuatan Aroma"	TEXT,
	"Daya Tahan"	TEXT,
	"Musim atau Cuaca"	TEXT,
	"Harga"	TEXT,
	"Ukuran Botol"	TEXT,
	"image_path"	TEXT,
	"created_at"	TIMESTAMP,
	"updated_at"	TIMESTAMP,
	"Gender"	TEXT,
	PRIMARY KEY("id" AUTOINCREMENT)
);
COMMIT;
